import homeImage from '../app/assets/images/tea-planting.jpg'

import teaLogo from '../app/assets/images/teaLogo.png';
import './HomeCard.css'
const HomeCard = () => {
    return (
        <div id="imageContainer">
            <img src={homeImage} alt='home-image' className='float-start' />
        </div>
    );
};

export default HomeCard;
